import axios from 'axios';
import styles from './Navbar.module.css';
import { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import { Outlet } from "react-router-dom";
import { useNavigate } from 'react-router-dom';


export default function Navbar(){
    const navigate = useNavigate();
       const [user,setUser] = useState('') 

        const handlelogout = async() => {
            const res = await axios.post('http://127.0.0.1:8000/api/users/logout/')
            setUser('')
            navigate('/login')

        }

         const func = async () => {

  const res = await axios.get('http://127.0.0.1:8000/api/users/',{
      withCredentials: true
    } )
    setUser(res.data.user)


  }

      useEffect(() => {
      const get_user = async() => {  func();
      };

      get_user();

},[])

    return (
        <div>
        <nav className={styles.navBar}>
        <h1>Know Your Health</h1>

       <Link to='/Labs' className={styles.lablink}>Labs</Link>
        <Link to='/Labs' className={styles.lablink}>Register Lab </Link>
       {/* <Link to='/Login'> <button className={styles.logbtn}>Login/Signup</button></Link> */}
     {!user ? <Link to='/Login'> <button className={styles.logbtn}>Login/Signup</button></Link> : <button onClick={handlelogout}>Logout</button>}
      {/* <button onClick={handlelogout}>Logout</button> */}
        </nav>
        <Outlet />

        </div>
    )
}
